import React, {Component} from 'react';

export default class componentName extends Component {
  render() {
    return (
      <>
      <div className="flex justify-between">
        <h1 className="bg-red-500"> <b>SHOP</b>bine </h1>
        <li>Support</li>
        <li>Join Us</li>
        <li>Developers</li>
      </div>
      </>
    )
  }
}
